// src/components/common/Card.js
import React from 'react';
import './Buttons.css'

function ButtonGreen({ handle, onClick}) {
  return (
    <div className="button-green"
        onClick={onClick}
    >
        {handle}
    </div>
  );
}

export default ButtonGreen;
